import React, { useState } from 'react'
import HourlyChart from './Charts/HourlyChart';
import MinuteChart from './Charts/MinuteChart';

const ChartData = () => {
  const [chartType, setChartType] = useState('hour');
  // write a case statement to determine which chart to render
  
  return (
    <div>
      <button onClick={()=>{setChartType('hour')}}></button>
      <button onClick={()=>{setChartType('mins')}}></button>

      <HourlyChart/>
      <MinuteChart/>
    </div>
  )
}

export default ChartData
